// src/FoodTypeCards.js
import React, { useState } from 'react';

const FoodTypeCards = ({ onFoodTypeChange }) => {
 const [selectedFoodType, setSelectedFoodType] = useState('');

 const handleFoodTypeClick = (type) => {
    setSelectedFoodType(type);
    onFoodTypeChange(type);
 };

 return (
    <div className="cards-list">
      <div className="card" onClick={() => handleFoodTypeClick('Veg')}>
        <div className="card_image">
          <img src="https://i.redd.it/b3esnz5ra34y.jpg" alt="Veg" />
        </div>
        <div className="card_title title-white">
          <p>Veg</p>
        </div>
      </div>
      <div className="card" onClick={() => handleFoodTypeClick('Non-Veg')}>
        <div className="card_image">
          <img src="https://i.redd.it/b3esnz5ra34y.jpg" alt="Non-Veg" />
        </div>
        <div className="card_title title-white">
          <p>Non-Veg</p>
        </div>
      </div>
    </div>
 );
};

export default FoodTypeCards;
